import classes from './AddUser.module.css';

import React from 'react'

const AddUser = () => {
  return (
    <div>

        <form className={classes.input}>
            <label>Username</label>
            <input type='text'></input>
            <label>Age (Years)</label>
            <input type='number'></input>

        </form>
    </div>
  )
}

export default AddUser
